import logo from "./logo.svg";
import React from "react";
import "./App.css";
import NodeRSA from "node-rsa";

function App() {
  const key = NodeRSA({ b: 1024 });
  let public_key = key.exportKey("public");
  let private_key = key.exportKey("private");

  console.log(public_key);
  console.log(private_key);

  function genarate() {
    localStorage.setItem();
  }

  return (
    <React.Fragment>
      <div className="App">
        <h1>Hello world </h1>
      </div>
      <div className="App">
        <p>{public_key}</p>
      </div>
      <div className="App">
        <p>{private_key}</p>
      </div>
      <div className="App">
        <button onClick={genarate}>genarate</button>
      </div>
    </React.Fragment>
  );
}

export default App;
